duced independently of the TED Conferences. Everyone makes assumptions about people they don’t know. Melanie will teach us to recognize these assumptions and work toward a common understanding.\\n\\nMs. Melanie Funchess is currently employed by the Mental Health Association where she serves as the Director of Community Engagement. She is also involved in several community based coalitions and organizations such as the African American Leadership Development Program, African American Health Coalition, Black Women’s Leadership Forum, Greater Rochester Parent Leadership Training Institute, the Mental Health Promotion Task Force, and the Neighborhood Consortium for Youth Justice. She is a founding member of the Coalition for the Beloved Community. The Coalition’s mission is to serve as a “countywide movement to build a culture of peace; grounded in dignity and fed by hope”.\\r\\n\\r\\nShe is a devoted wife and mother of four children (two boys and two girls) three of whom experience mental\/ emotional challenges. Her mission is to use her knowledge of systems and communities to create opportunities for youth and families to be empowered and successful and to break down the walls that separate us and build bridges to unite us as one community where every child is our own, we have front porch neighborhoods, and we use language that respects everyone.\\n\\nAbout TEDx, x = independently organized event In the spirit of ideas worth spreading, TEDx is a program of local, self-organized events that bring people together to share a TED-like experience. At a TEDx event, TEDTalks video and live speakers combine to spark deep discussion and connection in a small group. These local, self-organized events are branded TEDx, where x = independently organized TED event. The TED Conference provides general guidance for the TEDx program, but individual TEDx events are self-organized.* (*Subject to certain rules and regulations)\",\"isCrawlable\":true,\"thumbnail\":{\"thumbnails\":[{\"url m for Youth Justice. She is a founding member of the Coalition for the Beloved Community. The Coalition’s mission is to serve as a “countywide movement to build a culture of peace; grounded in dignity and fed by hope”.\r\n\r\nShe is a devoted wife and mother of four children (two boys and two girls) three of whom experience mental/ emotional challenges. Her mission is to use her knowledge of systems and communities to create opportunities for youth and families to be empowered and successful and to break down the walls that separate us and build bridges to unite us as one community where every child is our own, we have front porch neighborhoods, and we use language that respects everyone.\n\nAbout TEDx, x = independently organized event In the spirit of ideas worth spreading, TEDx is a program of local, self-organized events that bring people together to share a TED-like experience. At a TEDx event, TEDTalks video and live speakers combine to spark deep discussion and connection in a small group. These local, self-organized events are branded TEDx, where x = independently organized TED event. The TED Conference provides general guidance for the TEDx program, but individual TEDx events are self-organized.* (*Subject to certain rules and regulations)"}]},"subscribeButton":{"buttonRenderer":{"style":"STYLE_DESTRUCTIVE","size":"SIZE_DEFAULT","isDisabled":false,"text":{"runs":[{"text":"Subscribe"}]},"navigationEndpoint":{"clickTrackingParams":"CJUBEJsrIhMIrdaQ6OeT6gIVENdVCh1R6gsm","commandMetadata":{"webCommandMetadata":{"ignoreNavigation":true}},"modalEndpoint":{"modal":{"modalWithTitleAndButtonRenderer":{"title":{"simpleText":"Want to subscribe to this channel?"},"content":{"simpleText":"Sign in to subscribe to this channel."},"button":{"buttonRenderer":{"style":"STYLE_BLUE_TEXT","size":"SIZE_DEFAULT","isDisabled":false,"text":{"simpleText":"Sign in"},"navigationEndpoint":{"clickTrackingParams":"CJYBEP2GBCITCK3WkOjnk-oCFRDXVQodUeoLJjIJc3Vic2NyaWJl","commandMetadata":{" andom=912884290","elapsedMediaTimeSeconds":0}},"videoDetails":{"videoId":"Fr8G7MtRNlk","title":"Implicit Bias -- how it effects us and how we push through | Melanie Funchess | TEDxFlourCity","lengthSeconds":"972","keywords":["ted talks","Politics","Economics","Lifestyle","ted talk","ted x","ted","Health","Social Justice","English","Life","tedx","Public Policy","TEDxTalks","Philosophy","Psychology","United States","tedx talk","Law","tedx talks","Culture"],"channelId":"UCsT0YIqwnpJCM-mx7-gSA4Q","isOwnerViewing":false,"shortDescription":"This talk was given at a local TEDx event, produced independently of the TED Conferences. Everyone makes assumptions about people they don’t know. Melanie will teach us to recognize these assumptions and work toward a common understanding.\n\nMs. Melanie Funchess is currently employed by the Mental Health Association where she serves as the Director of Community Engagement. She is also involved in several community based coalitions and organizations such as the African American Leadership Development Program, African American Health Coalition, Black Women’s Leadership Forum, Greater Rochester Parent Leadership Training Institute, the Mental Health Promotion Task Force, and the Neighborhood Consortium for Youth Justice. She is a founding member of the Coalition for the Beloved Community. The Coalition’s mission is to serve as a “countywide movement to build a culture of peace; grounded in dignity and fed by hope”.\r\n\r\nShe is a devoted wife and mother of four children (two boys and two girls) three of whom experience mental/ emotional challenges. Her mission is to use her knowledge of systems and communities to create opportunities for youth and families to be empowered and successful and to break down the walls that separate us and build bridges to unite us as one community where every child is our own, we have front porch neighborhoods, and we use language that respects everyone.\n\nAbout TEDx, x = independently organized event In t
